import React from 'react';
import Navbar from './navbar';
import './contact.css';
import { Container, Row, Col, Form, Button } from 'react-bootstrap';

const Contact = () => {
  return (
    <div className="container">
      <Navbar></Navbar>
      <Container>
      <div></div>
      </Container>
    </div>
  );
}

export default Contact;
